import React, { useState } from 'react'
import LearningContent from '../../components/LearningContent'
import { useSelector } from 'react-redux'
import { View } from 'react-native'


const ImportantQuestion = () => {

    const question = useSelector(state => state.questions.importantQuestion.data);
    const index = useSelector(state => state.questions.importantQuestion.index);
    const optionStyles = useSelector(state => state.questions.importantQuestion.style);

    return (
        <LearningContent question={question} typeQuestion="important" index={index} optionStyles={optionStyles} typeIndex="important" typeOptionStyle="SET_OPTION_STYLES_IQ" />
        // <View></View>
    )
}

export default ImportantQuestion
